import React, { useState, useEffect } from 'react';
import { View, Image, ImageBackground, Text } from 'react-native';
import { RectButton, ScrollView, TextInput } from 'react-native-gesture-handler';
import { useNavigation } from '@react-navigation/native';
import { useRoute } from '@react-navigation/native';
import ComboBox from 'react-native-combobox';

import styles from './estilo';

export default function tCadastroLocalU() {

    const route = useRoute();
    const [nome, setnome] = useState(route.params?.nome || '');
    const [cpf, setcpf] = useState(route.params?.cpf || '');
    const [celular, setcelular] = useState(route.params?.celular || '');
    const [email, setemail] = useState(route.params?.email || '');
    const [senha, setsenha] = useState(route.params?.senha || '');

    const [cep, setCep] = useState("")
    const [logradouro, setLogradouro] = useState("")
    const [localidade, setLocalidade] = useState("")
    const [uf, setUf] = useState("")

    const navigation = useNavigation();

    function Voltar() {
        navigation.goBack()
    }

    return (
        <ImageBackground style={styles.container}>
            <View style={styles.marginTop}>
                <Image style={{ width: 100, height: 109, marginTop: -30 }}
                    source={require('../../../assets/logo.png')} />
            </View>

            <View>
                <Text style={styles.title}>Cadastro Usuário</Text>
            </View>

            <ScrollView>
                <View style={styles.footer}>

                    <TextInput
                        style={styles.input}
                        value={cep}
                        placeholder="CEP"
                        onChangeText={(texto) => setendereco(texto)}
                    />

                    <RectButton style={styles.buttonNext}>
                        <Text style={styles.buttonText}>Buscar</Text>
                    </RectButton>

                    <Text style={styles.description}>Estado</Text>
                    <ComboBox
                        style={styles.input}
                        values={estados.map((estado) => estado.nome)}
                        onValueSelect={(texto) => setestado(texto)}
                    //onValueSelect={(texto) => setestado(texto)}
                    //onValueSelect={setestado}
                    />

                    <TextInput
                        style={styles.input}
                        placeholder="Cidade"
                        value={localidade}
                        onChangeText={(texto) => setcidade(texto)}
                    />

                    <TextInput
                        style={styles.input}
                        value={logradouro}
                        placeholder="Endereço"
                        onChangeText={(texto) => setendereco(texto)}
                    />

                </View>
            </ScrollView>

            <View>
                <RectButton style={styles.buttonNext} onPress={() => navigation.navigate('tCadastroFotoU', {
                    nome: nome, celular: celular, cpf: cpf, cep: cep, endereco: endereco, estado: estado, cidade: cidade, email: email, senha: senha,
                })}>
                    <Text style={styles.buttonText}>Avançar</Text>
                </RectButton>

                <RectButton style={styles.buttonReturn} onPress={Voltar}>
                    <Text style={styles.buttonText}>Voltar</Text>
                </RectButton>
            </View>
        </ImageBackground >
    );
}
